import React from "react";
import MealItem from "./MealItem/MealItem";
const DUMMY_MEALS = [
  {
    id: "m1",
    name: "test_NAME",
    description: "test_opis",
    weight: "130",
    price: "290",
  },
  {
    id: "m2",
    name: "test_NAME_test",
    description: "test_opis_test",
    weight: "130",
    price: "300",
  },
];

function MealList() {
  const mealList = DUMMY_MEALS.map((meal) => <MealItem>{meal.name}</MealItem>);
  return <section>{mealList}</section>;
}

export default MealList;
